import React from 'react';

import './Channels.css';
var channel = require('../Channel/Channel').channel;

//Change Fake Channel with {channel.name}

const Channels = () => (
    <div className="channels">
        <h5 align="center">List of the channels:</h5>
        <div>
            <ul>
                <li>{channel.name}</li>
            </ul>
        </div>
    </div>
)

export default Channels;
